import { useState } from "react";

function App() {
  const [todo, setTodo] = useState("");
  const onSubmit = (e) => e.preventDefault();

  return (
    <div>
      <form onSubmit={onSubmit}>
        <p>My ToDo</p>
        <input
          onChange={gettodo}
          value={todo}
          type="text"
          placeholder="write your todo list"
        ></input>
        <button>Add</button>
      </form>
    </div>
  );
}

export default App;
